import React from 'react'
import styled from 'styled-components'
import './Style.scss'

const Header = styled.div`
    display : flex;
    flex-direction : column;

`
const HeaderNav = styled.div`
    display : flex;
    flex-direction : row;
    align-items : center;
`;

class App extends React.Component {
    constructor() {
        super()
        this.state = {}
    }

    render() {
        return (
            <Header>
                <HeaderNav>
                    <button href="#">
                        <i className="material-icons md-dark">arrow_back</i>
                    </button>
                </HeaderNav>
            </Header>
        )
    }
}

export default App
